🇧🇷 O MELHOR  PRESIDENTE DO BRASIL É JAIR MESSIAS BOLSONARO!🇧🇷

AOS CONSERVADORES DO BRASIL 

Tão logo inicia a gestão do MAIOR CORRUPTO DO MUNDO, eleição roubada descaradamente,  pois nem na sua posse conseguiu reunir pessoas que justificasse sua vitória,  já vimos o rumo que o nosso Brasil vai tomar:
1. Desarmamento da população de bem;
2. Liberação do aborto; 
3. Associação com ditadores assassinos;
4. Loteamento das empresas públicas;
5. Fim das privatizações;
6. Volta da corrupção;
7. Distribuição de verbas para vampiros da Lei Rouanet;
8. Censura e perseguição à conservadores;
Enfim, rumo ao socialismo e comunismo. 
ESQUEÇAMOS ELEIÇÕES LIMPAS DORAVANTE!
Acreditar que alguma coisa vai mudar, tal como: vão entregar o código fonte das eleições; vão anular a posse do LADRÃO; o congresso vai segurar as pautas comunistas; etc, é muita ingenuidade nossa, pois QUEM ELEGEU O CRIMINOSO FOI A PRÓPRIA JUSTIÇA- STF E TSE. 
Se continuar esse governo ilegítimo,  ainda vão colocar mais dois ministros no STF.
Por outro lado, Bolsonaro agora não pode fazer mais nada. As FORÇAS ARMADAS só vão atuar por força de GARANTIA DA LEI E DA ORDEM. Se com todos os motivos ocorridos em 2022, entre os quais: eleições fraudulentas; parcialidade do STF/TSE; ingerência do Judiciário nos outros poderes; povo mais de 60 dias em todo o Brasil,  etc, eles não agiram, não vai ser com pouco barulho que isso vai acontecer. 
Por outro lado, mostramos o patriotismo,  a resiliência,  a determinação,  enfim,  a força que o povo de bem tem, ao permanecer por mais de 60 dias mobilizados, quer nos quartéis ou nas ruas. Essa mobilização mostra que, se quisermos,  poderemos mudar o rumo dessa atual trajetória nefasta.
COM CERTEZA, NÓS CONSERVADORES,  somos no mínimo 70 % da população.
Temos que unir todos os grupos,  agronegócio,  empresários, indígenas, caminhoneiros e o povo em geral e partir para uma GREVE GERAL, sem interrupção de estradas, sem conflitos,  onde parem todos: portos, aeroportos,  estradas,  empresas,  comércio,  indústria e agronegócio. 
Somente assim,  com sacrifício maior, poderemos mudar o rumo negro que se avizinha.
Que COORDENADORES DE GRUPOS, EMPRESÁRIOS, CAMINHONEIROS E ENTIDADES DE CLASSE se organizem por estado e possamos fazer história em nível mundial, libertando nosso país desse GRUPO CRIMINOSO QUE SE APOSSOU DAS NOSSAS VIDAS.
04/01/2023
